import React from 'react';
import Sports from './containers/Sports';
import General from './containers/General';
import Politics from './containers/Politics';
import './App.css';

function App() {
  return (
    <div className="App">
      < Sports />
      < General />
    < Politics />
    </div>
  );
}

export default App;
